import styled from 'styled-components';


export const Content = styled.div`
overflowY: scroll;
height: 2500px;
`;

export const Button = styled.div`
position: fixed;
width: 100%;
left: 94%;
bottom: 56px;
height: 30px;
font-size: 3rem;
z-index: 2;
cursor: pointer;
color: red;
`
